--------------------------------------------------------
--  DDL for Table categories_tab
--------------------------------------------------------
CREATE TABLE categories_tab( 
	CATEGORY_ID             INT NOT null, 
	CATEGORY_NAME           VARCHAR(50) NOT null, 
	CATEGORY_DESCRIPTION    VARCHAR(1000) NOT null,
	PARENT_CATEGORY_ID      INT,
	CONSTRAINT CAT_PK PRIMARY KEY (CATEGORY_ID) 
);

--------------------------------------------------------
--  DDL for Table customers
--------------------------------------------------------
CREATE TABLE customers(
	CUSTOMER_ID 		INT NOT null, 
	CUST_FIRST_NAME 	VARCHAR(20) NOT null, 
	CUST_LAST_NAME 		VARCHAR(20) NOT null, 
	CUST_STREET_ADDRESS	VARCHAR(100) NOT null,
	CUST_POSTAL_CODE	VARCHAR(10),
	CUST_CITY			VARCHAR(20),
	CUST_STATE  		VARCHAR(20),
	CUST_COUNTRY 		VARCHAR(20),
	PHONE_NUMBERS 		VARCHAR(100),
	NLS_LANGUAGE 		VARCHAR(3), 
	NLS_TERRITORY 		VARCHAR(30), 
	CREDIT_LIMIT 		DECIMAL(9,2) DEFAULT 0 NOT null, 
	CUST_EMAIL 			VARCHAR(30), 
	ACCOUNT_MGR_ID 		INT, 
	CUST_GEO_LOCATION 	JSON, 
	DATE_OF_BIRTH 		DATE, 
	MARITAL_STATUS 		VARCHAR(20), 
	GENDER 				VARCHAR(1), 
	INCOME_LEVEL 		VARCHAR(20),
	CONSTRAINT CUS_PK PRIMARY KEY (CUSTOMER_ID) ,
	CONSTRAINT CREDIT_LIMIT_MAX_CK CHECK (credit_limit <= 5000) ,
	CONSTRAINT MARITAL_STATUS_CK CHECK (MARITAL_STATUS IN ('single','married') )
);

-------------------------------------------------------
--  DDL for Table inventories
--------------------------------------------------------
CREATE TABLE inventories(
	PRODUCT_ID 			INT NOT null, 
	WAREHOUSE_ID 		INT NOT null, 
	QUANTITY_ON_HAND 	DECIMAL(8,0) DEFAULT 0 NOT null,
	CONSTRAINT INV_PK PRIMARY KEY (PRODUCT_ID, WAREHOUSE_ID) 
);

--------------------------------------------------------
--  DDL for Table orders
--------------------------------------------------------
CREATE TABLE orders(
	ORDER_ID 		INT NOT null, 
	ORDER_DATE 		TIMESTAMP (6), 
	ORDER_MODE 		VARCHAR(8) NOT null, 
	CUSTOMER_ID		INT NOT null, 
	ORDER_STATUS 	INT NOT null, 
	ORDER_TOTAL 	DECIMAL(8,2) DEFAULT 0 NOT null , 
	SALES_REP_ID 	INT,
	PROMOTION_ID 	INT,
	CONSTRAINT ORD_PK PRIMARY KEY (ORDER_ID) ,
	CONSTRAINT ORDER_TOTAL_CK CHECK (order_total >= 0) ,
	CONSTRAINT ORDER_MODE_CK CHECK (order_mode in ('direct','online')) ,
	CONSTRAINT ORDER_STATUS_CK CHECK (order_status BETWEEN 0 AND 10) 
);

--------------------------------------------------------
--  DDL for Table order_items
--------------------------------------------------------
CREATE TABLE order_items( 
	ORDER_ID 		INT NOT null, 
	PRODUCT_ID 		INT NOT null, 
	LINE_ITEM_ID 	INT NOT null, 
	UNIT_PRICE 		DECIMAL(8,2) DEFAULT 0 NOT null, 
	QUANTITY 		DECIMAL(8,0) DEFAULT 0 NOT null,
	CONSTRAINT ORI_PK PRIMARY KEY (ORDER_ID, PRODUCT_ID) ,
	CONSTRAINT LINE_ITEM_UK UNIQUE (ORDER_ID, LINE_ITEM_ID) 
);

--------------------------------------------------------
--  DDL for Table promotions
--------------------------------------------------------
CREATE TABLE promotions(
	PROMOTION_ID 	INT NOT null, 
	PROMO_NAME 		VARCHAR(20) NOT null,
	CONSTRAINT PRO_PK PRIMARY KEY (PROMOTION_ID) 
);

--------------------------------------------------------
--  DDL for Table product_information
--------------------------------------------------------
CREATE TABLE product_information(
	PRODUCT_ID 			INT NOT null, 
	PRODUCT_NAME 		VARCHAR(50) NOT null, 
	PRODUCT_DESCRIPTION	VARCHAR(2000) NOT null, 
	CATEGORY_ID 		INT NOT null, 
	WEIGHT_CLASS 		DECIMAL(1,0), 
	WARRANTY_PERIOD 	DECIMAL(2), 
	SUPPLIER_ID 		DECIMAL(6,0), 
	PRODUCT_STATUS 		VARCHAR(20) NOT null, 
	LIST_PRICE 			DECIMAL(8,2), 
	MIN_PRICE 			DECIMAL(8,2), 
	CATALOG_URL 		VARCHAR(50),
	CONSTRAINT PRI_PK PRIMARY KEY (PRODUCT_ID) ,
	CONSTRAINT PRODUCT_STATUS_CK CHECK (PRODUCT_STATUS in ('orderable','planned','under development','obsolete')) 
);

--------------------------------------------------------
--  DDL for Table product_descriptions
--------------------------------------------------------
CREATE TABLE product_descriptions(
	PRODUCT_ID 				INT NOT null, 
	LANGUAGE_ID 			VARCHAR(3) NOT null, 
	TRANSLATED_NAME 		VARCHAR(50) NOT null, 
	TRANSLATED_DESCRIPTION 	VARCHAR(2000) NOT null,
	CONSTRAINT PRD_PK PRIMARY KEY (PRODUCT_ID, LANGUAGE_ID) 
);

--------------------------------------------------------
--  DDL for Table warehouses
--------------------------------------------------------
CREATE TABLE warehouses(
	WAREHOUSE_ID	INT NOT null, 
	WAREHOUSE_NAME	VARCHAR(35) NOT null, 
	LOCATION_ID		INT NOT null, 
	WAREHOUSE_SPEC	VARCHAR(100), 
	WH_GEO_LOCATION	VARCHAR(100),
	CONSTRAINT WAR_PK PRIMARY KEY (WAREHOUSE_ID) 
);

