--------------------------------------------------------
--  DDL for View customers_VIEW 
--------------------------------------------------------

CREATE OR REPLACE VIEW customers_VIEW( 
	CUSTOMER_ID, CUST_FIRST_NAME, CUST_LAST_NAME, 
	CUST_EMAIL,
	PHONE_1, PHONE_2, PHONE_3, PHONE_4, 
	ACCOUNT_MGR_ID,
	MGR_FIRST_NAME, MGR_LAST_NAME ) AS 
SELECT 
	c.customer_id,
	c.cust_first_name,
	c.cust_last_name,
	c.cust_email,
	substr(phone_NUMBERS,1,16),
	substr(phone_NUMBERS,16,16),
	substr(phone_NUMBERS,32,16),
	substr(phone_NUMBERS,48,16),
	c.account_mgr_id,
	null, null
FROM customers c;